import React from 'react';

  const MemeCard = ({ meme }) => {
    return (
      <div className="meme-card">
        <Link to={`/caption/${meme.id}`}>
          <img className="meme-picture" src={meme.url} alt={meme.name} />
          <p>{meme.name}</p>
        </Link>
      </div>
    );
  };

  export default MemeCard;
